import React from 'react';
import './style/App.css';
import Login from './components/Login'
import Cadastro from './components/Cadastro'

function App() {
    let rota = 'Login'
    if (rota === 'Login') {
        return <Login onCadastrar={event => { rota = 'Cadastro' }}/>;
    } else if (rota === 'Cadastro') {
        return <Cadastro onVoltar={event => { rota = 'Login' }}/>;
    }
}

export default App;
